import React, { Component } from 'react';
import {Route,NavLink as Router,Switch,} from 'react-router-dom'
import { BrowserRouter } from 'react-router-dom';
import Patient from './patient/patientmain';
import Doctor from './Doctor/Doctormain';


class Home extends Component {
  render() {
      return (
        <>
        <BrowserRouter>
          <div className='container-fluid'>
              <div className='row'>
                  <ul className='sidebar-submenu '>
                      <li>
                          <NavLink Link to='/patient' ClassName='active'>Patient</NavLink>
                      </li>
                      <li>
                          <NavLink Link to='/doctor' ClassName='active'>Doctor</NavLink>
                      </li>
                  </ul>
                  <div className='col-md-10 admin-content'>
                      <Switch>
                          <Route exact path='/patient' component={Patient} />
                          <Route exact path='/doctor' component={Doctor} />
                      </Switch>
                  </div>
              </div>
          </div>
          </BrowserRouter>
          </>
      );
  }
}

export default Home;





































